import React, { useState } from "react"
import { Input } from 'antd';

const { TextArea } = Input;

const Header = () => {
    const [text, setText] = useState('')
    return (
        <>
            {/* <TextArea rows={4} />
            <br />
            <br />
            <TextArea rows={4} placeholder="maxLength is 6" maxLength={6} /> */}
            <br /><br />
            <div />
            <input type="text" id="inputText" onChange={e => setText(e.target.value)} placeholder="text" />
            <br /><br />
            <textarea id="outputText" placeholder="Password" value={text} />
        </>
    )
}

export default Header
